import React from 'react'
import DateTimePicker from 'react-datetime-picker'

function PopupContent({eventDetail}) {

    return (
        <div>
            <h4> Title: <textarea className='note_text' onChange/> {eventDetail.title} </h4>
            <h4>Starts: {eventDetail.start} <DateTimePicker /></h4>
            <h4>Ends: {eventDetail.end} <DateTimePicker /></h4>
        </div>
    )
}

export default PopupContent
